english:
We noticed that the password changed for your Roblox account: {userName}. If you didn't intend to change it, or you think someone else changed it by mistake, please click this link to undo the action:
{urlWithTicket}

If you are happy with your new Roblox password, you don't have to do anything! It's already set up. Please do not reply to this message. If you have any questions, please see the Roblox help page (https://www.roblox.com/help).

translation:
Мы заметили, что пароль твоего аккаунта Roblox был изменён: {userName}. Если это произошло случайно, или ты думаешь, что кто-то другой изменил его по ошибке, пожалуйста, пройди по ссылке ниже:
{urlWithTicket}

Если тебе нравится новый пароль Roblox, то ничего не нужно делать. Всё уже настроено. Пожалуйста, не отвечай на это сообщение. Если у тебя есть вопросы, посети Справочный центр Roblox (https://www.roblox.com/help).

english:
Moving forward, subscribers will be granted a monthly lump sum of Robux instead of receiving it in daily increments. Today, we’re depositing {robuxAmount} Robux in your account to make up for the remaining amount you would have earned this month.
{newLine}{newLine}
Check your Roblox Inbox for more details.

translation:
Чем дальше продвигается подписчик, тем больше возрастает его ежемесячное получение Robux вместо ежедневного. Сегодня мы переводим {robuxAmount} Robux на вашу учетную запись, чтобы пополнить ваш счет за текущий месяц.
{newLine}{newLine}
Проверьте вашу учетную запись Roblox.

english:
