translation:
В дальнейшем подписчикам будет предоставляться ежемесячная единовременная выплата Robux вместо ежедневной. Сегодня мы переводим {robuxAmount} Robux на ваш счет, чтобы компенсировать оставшуюся сумму, которую вы бы заработали в этом месяце.
